	  		{movies.length === 3?
	  		<img src={`http://image.tmdb.org/t/p/w1280/${movies[0].backdrop_path}`} />
	  		:<div>loading</div>
	  		}
	  	</div>


	  </div>
  	)	  
}



export default Showcase;
